def remove_blank_list(snail_map):
    try:
        snail_map.remove([])
    except ValueError:
        pass

def snail(snail_map):
    new_array=[]
    while snail_map != []:
        for x in range(0,len(snail_map[0])):
            new_array.append(snail_map[0].pop(0))
        remove_blank_list(snail_map)
        for x in range(0,len(snail_map)):
            new_array.append(snail_map[x].pop())
        for x in range(0,len(snail_map)):
            new_array.append(snail_map[len(snail_map)-1].pop())
        remove_blank_list(snail_map)
        for x in range(1,len(snail_map)):
            new_array.append(snail_map[len(snail_map)-x].pop(0))
    return new_array




